import React, {useState, useEffect} from "react";
import {GetPostingInfo} from "../../components/firebase/getPostingInfo";

export async function GetData(url) {
    // console.log(url);
    const data = await GetPostingInfo(url);
    // console.log(data);
    await WorksView(data);
}

export default function WorksView({match}) {
    // console.log(url);
    const [inputData, setInputData] = useState({});
    useEffect(() => {
        async function exec(){
            const data = await GetPostingInfo(match.params.urlId);
            setInputData(data);
        }
        exec();
    },[])
    // console.log(inputData);

    const name = inputData.name;
    console.log(name);
    return(
        <>
            <div className="student_area">
                <div>
                    <button></button>
                </div>
            </div>
        </>
    )
}
